"""
created by huash06 at 2015-04-14 21:37


Given a 2D board containing 'X' and 'O', capture all regions surrounded by 'X'.

A region is captured by flipping all 'O's into 'X's in that surrounded region.

For example,
X X X X
X O O X
X X O X
X O X X
After running your function, the board should be:

X X X X
X X X X
X X X X
X O X X


"""

__author__ = 'huash06'

import sys
import os


class Solution:
    # @param board, a 2D array
    # Capture all regions by modifying the input board in-place.
    # Do not return any value.
    def solve(self, board):
        if not board:
            return

        delta = [(-1, 0), (1, 0), (0, -1), (0, 1)]
        not_surrounded = set()
        for r in range(len(board)):
            for c in range(len(board[r])):
                if board[r][c] == 'O' and (r, c) not in not_surrounded:
                    q = [(r, c)]
                    visited = {(r, c)}
                    surrounded = True
                    while q:
                        loc = q.pop()
                        # print(loc)
                        for d in delta:
                            nr = loc[0] + d[0]
                            nc = loc[1] + d[1]
                            if nr < 0 or nr >= len(board) or nc < 0 or nc >= len(board[r]):
                                surrounded = False
                                break
                            nloc = (nr, nc)
                            if board[nr][nc] == 'O' and nloc not in visited:
                                visited.add(nloc)
                                q.append(nloc)
                    if surrounded:
                        for loc in visited:
                            board[loc[0]][loc[1]] = 'X'
                    else:
                        not_surrounded = not_surrounded.union(visited)

s = Solution()

board = [
    ['X', 'X', 'X', 'X'],
    ['X', 'O', 'O', 'X'],
    ['X', 'X', 'O', 'X'],
    ['X', 'O', 'X', 'X']
]
s.solve(board)
for r in board:
    print(r)
print('')

board = list(map(list, ["XOX","XOX","XOX"]))
s.solve(board)
